import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css'; 
import { useHistory } from 'react-router-dom';


const Header = () => {
  const history = useHistory();

    const handleLogout = async () => {
      try {
        const response = await axios.post('http://localhost:8000/logout', {
          
        });
  
        
        console.log(response.data); 
        history.push('/login');
      } catch (error) {
        console.log(error);
      }
    };
  

  return (
    <div>
      <div className='heading'>
        <h1 className='h1'>Student Portal</h1>
        <p className='para'>University info</p>
        <button className='lb' onClick={handleLogout}>Logout</button>
      </div>
      <div className="header-container">
        <Link to="/course-details" className="header-link">Course Details</Link>
        <Link to="/hostel" className="header-link">Hostel</Link>
        <Link to="/events" className="header-link">Events</Link>
        <Link to="/others" className="header-link">Others</Link>
      </div>
    </div>
  );
};

export default Header;
